import { useState, useEffect } from "react"
import { makeStyles } from '@material-ui/core/styles'
import Container from '@material-ui/core/Container'
import Box from '@material-ui/core/Box'
import SingleSelect from './SingleSelect';
import SelectMultipl from './SelectMultiple';

const useStyles = makeStyles(theme => ({
  root: {
    width: "100%",
    height:70,
    background: "transparent",
    padding:15,
  },
}));

const Filters = props => {
  const classes = useStyles()



  return (
    <Box className={classes.root}>
      <SingleSelect filter="clientType" options={props.catalogue.clientTypes} onChange={props.onChange}/>
      <SelectMultiple filter="specialty" options={props.catalogue.specialties} onChange={props.onChange}/>
    </Box>
  )
}

export default Filters
